import { PrismaClient } from "@prisma/client";
const prisma = new PrismaClient();

console.log("seeding products categories...");
async function main() {
	let productsCategories = await prisma.productsCategories.findFirst();

	if (!productsCategories) {
		await prisma.productsCategories.createMany({
			data: [
				{ name: "Camisas" },
				{ name: "Moletons e Casacos" },
				{ name: "Shorts" },
				{ name: "Canecas" },
			],
		});
	}

	let products = await prisma.products.findFirst();
	if (!products) {
		await prisma.products.createMany({
			data: [
				{
					name: "Caneca cachorrada",
					description: "A melhor caneca para você entrosar nos eventos!",
					price: 3000,
					stockQtd: 100,
					pictureURL:
						"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSh9cmNmCpp8l5E1w0T-8LulWxfXIg4Cq3En0YMjC2Y655uCLuue3S3kDTLTZ-3yIqQfE4&usqp=CAU",
					categoryId: 4,
				},
				{
					name: "Camisa Engenharia UFRJ",
					description:
						"Vista o manto sagrado de qualquer engenheiro do fundão!",
					price: 4000,
					stockQtd: 100,
					pictureURL:
						"data:image/jpeg;base64,",
					categoryId: 1,
				},
				{
					name: "Casaco UFRJ",
					description: "Se proteja do frio com o casaco do seu curso!",
					price: 6000,
					stockQtd: 100,
					pictureURL:
						"data:image/jpeg;base64,",
					categoryId: 2,
				},
				{
					name: "Shorts cachorrada",
					description:
						"Aproveite os jogos universitários no maior conforto possível (em dias quentes)",
					price: 5000,
					stockQtd: 100,
					pictureURL:
						"data:image/jpeg;base64,",
					categoryId: 4,
				},
			],
		});
	}
}

main()
	.catch(async (error) => {
		console.log(error);
		await prisma.$disconnect();
		process.exit(1);
	})
	.finally(async () => {
		await prisma.$disconnect();
	});
